function generateCreditCard() {
  const randomIndex = getRandomInt(0, creditcard.length - 1);
  const card = { ...creditcard[randomIndex] }; // Cria uma cópia do objeto
  const currentYear = new Date().getFullYear();
  const futureYear = currentYear + 2;

  const dateParts = card.date.split("/");
  const month = dateParts[0];
  const year = futureYear.toString();
  card.date = `${month}/${year}`;

  return card;
}

function generateAge(min = 18, max = 60) {
  return getRandomInt(min, max);
}

function generateRNE() {
  const letter = "W";

  const randomNumber = Math.floor(Math.random() * 100000000)
    .toString()
    .padStart(8, "0");

  const checkDigit = Math.floor(Math.random() * 10);

  return `${letter}${randomNumber}-${checkDigit}`;
}
function generatePlate() {
  const randomLetter = () =>
    String.fromCharCode(65 + Math.floor(Math.random() * 26));

  const randomDigit = () => Math.floor(Math.random() * 10);

  const oldPlate = `${randomLetter()}${randomLetter()}${randomLetter()}-${randomDigit()}${randomDigit()}${randomDigit()}${randomDigit()}`;

  const mercosulPlate = `${randomLetter()}${randomLetter()}${randomLetter()}${randomDigit()}${randomLetter()}${randomDigit()}${randomDigit()}`;

  return {
    oldFormat: oldPlate,
    mercosulFormat: mercosulPlate,
  };
}

