function generateLoremIpsum(wordCount = 1) {
  const loremIpsum =
    "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.";

  const words = loremIpsum.split(" ");
  const totalWords = words.length;
  let result = "";

  for (let i = 0; i < wordCount; i++) {
    result += words[i % totalWords] + " ";
  }

  result = result.trim() + ".";

  return result;
}

function generateDate(day = 0, month = 0, year = 0) {
  const resultDate = new Date();

  resultDate.setDate(resultDate.getDate() + day);
  resultDate.setMonth(resultDate.getMonth() + month);
  resultDate.setFullYear(resultDate.getFullYear() + year);

  function padTo2Digits(num) {
    return num.toString().padStart(2, "0");
  }

  function brazilianFormat(date) {
    return {
      date: `${padTo2Digits(date.getDate())}/${padTo2Digits(
        date.getMonth() + 1
      )}/${date.getFullYear()}`,
      time: `${padTo2Digits(date.getHours())}:${padTo2Digits(
        date.getMinutes()
      )}:${padTo2Digits(date.getSeconds())}`,
      dateTime: `${padTo2Digits(date.getDate())}/${padTo2Digits(
        date.getMonth() + 1
      )}/${date.getFullYear()} ${padTo2Digits(date.getHours())}:${padTo2Digits(
        date.getMinutes()
      )}:${padTo2Digits(date.getSeconds())}`,
      timeStamp: date.getTime(),
      iso: date.toISOString(),
      stringFormat: date.toString(),
    };
  }

  const dateFormats = {
    iso: resultDate.toISOString(),
    utc: resultDate.toUTCString(),
    stringFormat: resultDate.toString(),
    localDate: resultDate.toLocaleDateString(),
    localTime: resultDate.toLocaleTimeString(),
    localDateTime: resultDate.toLocaleString(),
    timestamp: resultDate.getTime(),
    customFormat: `${resultDate.getFullYear()}-${padTo2Digits(
      resultDate.getMonth() + 1
    )}-${padTo2Digits(resultDate.getDate())} ${padTo2Digits(
      resultDate.getHours()
    )}:${padTo2Digits(resultDate.getMinutes())}:${padTo2Digits(
      resultDate.getSeconds()
    )}`,
    br: brazilianFormat(resultDate),
  };

  return dateFormats;
}
function generatePassword(length = 10) {
  const charset =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789!@#$%^&*()_+~`|}{[]:;?><,./-=";
  let password = "";
  for (let i = 0, n = charset.length; i < length; ++i) {
    password += charset.charAt(Math.floor(Math.random() * n));
  }
  return password;
}

function generateFakePolicyNumber(length = 10) {
  const characters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
  let policyNumber = "";

  for (let i = 0; i < length; i++) {
    const randomIndex = Math.floor(Math.random() * characters.length);
    policyNumber += characters.charAt(randomIndex);
  }

  return policyNumber;
}
