// Função para gerar um endereço IP aleatório
function generateRandomIP() {
  const ipParts = [];
  for (let i = 0; i < 4; i++) {
    const part = getRandomNumber(0, 255);
    ipParts.push(part);
  }
  return ipParts.join(".");
}

